import{_ as e,o as s,c as n,e as a}from"./app.32f1c884.js";const g=JSON.parse('{"title":"Contributing \u8D21\u732E","description":"","frontmatter":{},"headers":[{"level":2,"title":"Development \u90E8\u7F72","slug":"development-\u90E8\u7F72"},{"level":3,"title":"Setup \u8BBE\u7F6E","slug":"setup-\u8BBE\u7F6E"},{"level":2,"title":"Contributing \u8D21\u732E","slug":"contributing-\u8D21\u732E-1"},{"level":3,"title":"Existing functions \u5DF2\u6709\u51FD\u6570","slug":"existing-functions-\u5DF2\u6709\u51FD\u6570"},{"level":3,"title":"New functions \u65B0\u589E\u51FD\u6570","slug":"new-functions-\u65B0\u589E\u51FD\u6570"},{"level":3,"title":"New add-ons \u65B0\u589E\u9644\u52A0\u7EC4\u4EF6","slug":"new-add-ons-\u65B0\u589E\u9644\u52A0\u7EC4\u4EF6"},{"level":2,"title":"Project Structure \u9879\u76EE\u7ED3\u6784","slug":"project-structure-\u9879\u76EE\u7ED3\u6784"},{"level":3,"title":"Monorepo","slug":"monorepo"},{"level":3,"title":"Function Folder \u51FD\u6570\u6587\u4EF6\u5939","slug":"function-folder-\u51FD\u6570\u6587\u4EF6\u5939"},{"level":2,"title":"Code Style \u4EE3\u7801\u98CE\u683C","slug":"code-style-\u4EE3\u7801\u98CE\u683C"},{"level":2,"title":"Thanks \u81F4\u8C22","slug":"thanks-\u81F4\u8C22"}],"relativePath":"contributing.md"}'),o={name:"contributing.md"},l=a(`<h1 id="contributing-\u8D21\u732E" tabindex="-1">Contributing \u8D21\u732E <a class="header-anchor" href="#contributing-\u8D21\u732E" aria-hidden="true">#</a></h1><p>Thanks for being interested in contributing to this project!</p><p>\u611F\u8C22\u60A8\u6709\u5174\u8DA3\u4E3A\u672C\u9879\u76EE\u505A\u51FA\u8D21\u732E\uFF01</p><h2 id="development-\u90E8\u7F72" tabindex="-1">Development \u90E8\u7F72 <a class="header-anchor" href="#development-\u90E8\u7F72" aria-hidden="true">#</a></h2><h3 id="setup-\u8BBE\u7F6E" tabindex="-1">Setup \u8BBE\u7F6E <a class="header-anchor" href="#setup-\u8BBE\u7F6E" aria-hidden="true">#</a></h3><p>Clone this repo to your local machine and install the dependencies.</p><p>\u514B\u9686\u672C\u4ED3\u5E93\u5230\u4F60\u7684\u672C\u5730\u5E76\u5B89\u88C5\u4F9D\u8D56</p><div class="language-bash"><span class="copy"></span><pre class="vp-code-dark"><code><span class="line"><span style="color:#DBD7CA;">pnpm install</span></span>
<span class="line"></span></code></pre><pre class="vp-code-light"><code><span class="line"><span style="color:#393A34;">pnpm install</span></span>
<span class="line"></span></code></pre></div><p>We use VitePress for rapid development and documenting. You can start it locally by</p><p>\u6211\u4EEC\u4F7F\u7528 VitePress \u8FDB\u884C\u5FEB\u901F\u5F00\u53D1\u548C\u8BB0\u5F55\u3002\u53EF\u4EE5\u901A\u8FC7\u4EE5\u4E0B\u65B9\u5F0F\u5728\u672C\u5730\u542F\u52A8\uFF1A</p><div class="language-bash"><span class="copy"></span><pre class="vp-code-dark"><code><span class="line"><span style="color:#DBD7CA;">pnpm dev</span></span>
<span class="line"></span></code></pre><pre class="vp-code-light"><code><span class="line"><span style="color:#393A34;">pnpm dev</span></span>
<span class="line"></span></code></pre></div><h2 id="contributing-\u8D21\u732E-1" tabindex="-1">Contributing \u8D21\u732E <a class="header-anchor" href="#contributing-\u8D21\u732E-1" aria-hidden="true">#</a></h2><h3 id="existing-functions-\u5DF2\u6709\u51FD\u6570" tabindex="-1">Existing functions \u5DF2\u6709\u51FD\u6570 <a class="header-anchor" href="#existing-functions-\u5DF2\u6709\u51FD\u6570" aria-hidden="true">#</a></h3><p>Feel free to enhance the existing functions. Please try not to introduce breaking changes.</p><p>\u8BF7\u968F\u610F\u62D3\u5C55\u73B0\u6709\u51FD\u6570\u7684\u529F\u80FD\u3002\u8BF7\u5C3D\u91CF\u4E0D\u8981\u5F15\u5165\u7834\u574F\u6027\u7684\u66F4\u6539\u3002</p><h3 id="new-functions-\u65B0\u589E\u51FD\u6570" tabindex="-1">New functions \u65B0\u589E\u51FD\u6570 <a class="header-anchor" href="#new-functions-\u65B0\u589E\u51FD\u6570" aria-hidden="true">#</a></h3><p>There are some notes for adding new functions</p><p>\u6709\u4E00\u4E9B\u5173\u4E8E\u6DFB\u52A0\u65B0\u51FD\u6570\u7684\u63D0\u793A\uFF1A</p><ul><li><p>Before you start working, it&#39;s better to open an issue to discuss first.</p></li><li><p>The implementation should be placed under <code>packages/core</code> as a folder and exposing in <code>index.ts</code></p></li><li><p>In the <code>core</code> package, try not to introduce 3rd-party dependencies as this package is aimed to be as lightweight as possible.</p></li><li><p>If you&#39;d like to introduce 3rd-party dependencies, please contribute to @vueuse/integrations or create a new add-on.</p></li><li><p>You can find the function template under <code>packages/core/_template/</code>, details explained in the <a href="#function-folder">Function Folder</a> section.</p></li><li><p>When writing documentation for your function, the <code>&lt;!--FOOTER_STARTS--&gt;</code> and <code>&lt;!--FOOTER_ENDS--&gt;</code> will be automatically updated at build time, so don&#39;t feel the need to update them.</p></li><li><p>\u7F16\u5199\u65B0\u51FD\u6570\u4E4B\u524D\uFF0C\u6700\u597D\u5148\u5F00\u4E2A issue \u8BA8\u8BBA\u4E00\u4E0B\uFF1B</p></li><li><p>\u5728 <code>packages/core</code> \u4E0B\u521B\u5EFA\u6587\u4EF6\u5939\u5E76\u5B9E\u73B0\u65B0\u51FD\u6570\uFF0C \u5E76\u5728 <code>index.ts</code> \u4E2D\u66B4\u9732\u51FA\u6765\uFF1B</p></li><li><p>\u5728 <code>core</code> \u5305\u91CC\uFF0C\u5C3D\u91CF\u4E0D\u8981\u5F15\u5165\u7B2C\u4E09\u65B9\u4F9D\u8D56\uFF0C\u56E0\u4E3A\u672C\u5305\u65E8\u5728\u505A\u5230\u5C3D\u53EF\u80FD\u8F7B\u91CF\uFF1B</p></li><li><p>\u5982\u679C\u9700\u8981\u5F15\u5165\u7B2C\u4E09\u65B9\u4F9D\u8D56\uFF0C\u8BF7\u518D <code>@vueuse/integrations</code> \u4E0B\u521B\u5EFA\u6216\u8005\u521B\u5EFA\u4E00\u4E2A\u65B0\u7684\u9644\u52A0\u7EC4\u4EF6\uFF1B</p></li><li><p>\u53EF\u4EE5\u5728 <code>packages/core/_template/</code> \u627E\u5230\u51FD\u6570\u6A21\u677F\uFF0C \u8BE6\u60C5\u53C2\u89C1 <a href="#function-folder">\u51FD\u6570\u6587\u4EF6\u5939</a> \u677F\u5757\uFF1B</p></li><li><p>\u5F53\u4E3A\u65B0\u51FD\u6570\u7F16\u5199\u6587\u6863\u65F6\uFF0C<code>&lt;!--FOOTER_STARTS--&gt;</code> \u548C <code>&lt;!--FOOTER_ENDS--&gt;</code> \u4F1A\u5728\u6784\u5EFA\u9636\u6BB5\u81EA\u52A8\u751F\u6210\uFF0C\u6CA1\u6709\u5FC5\u8981\u624B\u52A8\u66F4\u65B0\uFF1B</p></li></ul><blockquote><p>Please note you don&#39;t need to update packages&#39; <code>index.ts</code>. They are auto-generated. \u8BF7\u6CE8\u610F\uFF1A \u4E0D\u5FC5\u66F4\u65B0 <code>packages</code> \u4E0B\u7684 <code>index.ts</code>. \u5B83\u4EEC\u662F\u81EA\u52A8\u751F\u6210\u7684\u3002</p></blockquote><h3 id="new-add-ons-\u65B0\u589E\u9644\u52A0\u7EC4\u4EF6" tabindex="-1">New add-ons \u65B0\u589E\u9644\u52A0\u7EC4\u4EF6 <a class="header-anchor" href="#new-add-ons-\u65B0\u589E\u9644\u52A0\u7EC4\u4EF6" aria-hidden="true">#</a></h3><p>New add-ons are greatly welcome!</p><p>\u975E\u5E38\u6B22\u8FCE\u6DFB\u52A0\u65B0\u7684\u9644\u52A0\u7EC4\u4EF6\uFF01</p><ul><li><p>Create a new folder under <code>packages/</code>, name it as your add-on name.</p></li><li><p>Add add-on details in <code>scripts/packages.ts</code></p></li><li><p>Create <code>README.md</code> under that folder.</p></li><li><p>Add functions as you would do to the core package.</p></li><li><p>Commit and submit as a PR.</p></li><li><p>\u5728 <code>packages/</code> \u4E0B\u65B0\u5EFA\u4E00\u4E2A\u6587\u4EF6\u5939\uFF0C\u5E76\u4EE5\u65B0\u9644\u52A0\u7EC4\u4EF6\u7684\u540D\u5B57\u547D\u540D\uFF1B</p></li><li><p>\u5728 <code>scripts/packages.ts</code> \u4E2D\u64B0\u5199\u9644\u52A0\u7EC4\u4EF6\u7684\u8BE6\u60C5\uFF1B</p></li><li><p>\u5728\u65B0\u5EFA\u7684\u6587\u4EF6\u5939\u4E0B\u521B\u5EFA <code>README.md</code> \u6587\u6863\uFF1B</p></li><li><p>\u5411 <code>core package</code> \u4E2D\u6DFB\u52A0\u51FD\u6570\uFF1B</p></li><li><p>\u63D0\u4EA4\u4EE3\u7801\u5E76\u4E14\u63D0\u4E2A PR</p></li></ul><h2 id="project-structure-\u9879\u76EE\u7ED3\u6784" tabindex="-1">Project Structure \u9879\u76EE\u7ED3\u6784 <a class="header-anchor" href="#project-structure-\u9879\u76EE\u7ED3\u6784" aria-hidden="true">#</a></h2><h3 id="monorepo" tabindex="-1">Monorepo <a class="header-anchor" href="#monorepo" aria-hidden="true">#</a></h3><p>We use monorepo for multiple packages</p><p>\u6211\u4EEC\u4F7F\u7528 <code>monorepo</code> \u6765\u7BA1\u7406\u591A\u4E2A\u5305</p><div class="language-"><span class="copy"></span><pre class="vp-code-dark"><code><span class="line"><span style="color:#dbd7ca;">packages</span></span>
<span class="line"><span style="color:#dbd7ca;">  shared/         - \u5171\u4EAB\u7684\u5DE5\u5177\u51FD\u6570</span></span>
<span class="line"><span style="color:#dbd7ca;">  core/           - \u6838\u5FC3\u5305</span></span>
<span class="line"><span style="color:#dbd7ca;">  firebase/       - Firebase \u9644\u52A0\u7EC4\u4EF6</span></span>
<span class="line"><span style="color:#dbd7ca;">  [...addons]/    - \u5176\u5B83\u9644\u52A0\u7EC4\u4EF6</span></span>
<span class="line"><span style="color:#dbd7ca;"></span></span></code></pre><pre class="vp-code-light"><code><span class="line"><span style="color:#393a34;">packages</span></span>
<span class="line"><span style="color:#393a34;">  shared/         - \u5171\u4EAB\u7684\u5DE5\u5177\u51FD\u6570</span></span>
<span class="line"><span style="color:#393a34;">  core/           - \u6838\u5FC3\u5305</span></span>
<span class="line"><span style="color:#393a34;">  firebase/       - Firebase \u9644\u52A0\u7EC4\u4EF6</span></span>
<span class="line"><span style="color:#393a34;">  [...addons]/    - \u5176\u5B83\u9644\u52A0\u7EC4\u4EF6</span></span>
<span class="line"><span style="color:#393a34;"></span></span></code></pre></div><h3 id="function-folder-\u51FD\u6570\u6587\u4EF6\u5939" tabindex="-1">Function Folder \u51FD\u6570\u6587\u4EF6\u5939 <a class="header-anchor" href="#function-folder-\u51FD\u6570\u6587\u4EF6\u5939" aria-hidden="true">#</a></h3><p>A function folder typicality contains these 4 files:</p><p>\u4E00\u4E2A\u5178\u578B\u7684\u51FD\u6570\u6587\u4EF6\u5939\u5305\u542B\u4EE5\u4E0B\u56DB\u4E2A\u6587\u4EF6\uFF1A</p><blockquote><p>You can find the template under <code>packages/core/_template/</code> \u53EF\u4EE5\u5728 <code>packages/core/_template/</code> \u627E\u5230\u51FD\u6570\u6A21\u677F</p></blockquote><div class="language-bash"><span class="copy"></span><pre class="vp-code-dark"><code><span class="line"><span style="color:#DBD7CA;">index.ts            </span><span style="color:#758575;"># \u51FD\u6570\u6E90\u7801</span></span>
<span class="line"><span style="color:#DBD7CA;">demo.vue            </span><span style="color:#758575;"># \u6587\u6863\u91CC\u7684 demo</span></span>
<span class="line"><span style="color:#DBD7CA;">index.test.ts       </span><span style="color:#758575;"># \u57FA\u4E8E vitest \u7684\u6D4B\u8BD5</span></span>
<span class="line"><span style="color:#DBD7CA;">index.md            </span><span style="color:#758575;"># \u6587\u6863</span></span>
<span class="line"></span></code></pre><pre class="vp-code-light"><code><span class="line"><span style="color:#393A34;">index.ts            </span><span style="color:#A0ADA0;"># \u51FD\u6570\u6E90\u7801</span></span>
<span class="line"><span style="color:#393A34;">demo.vue            </span><span style="color:#A0ADA0;"># \u6587\u6863\u91CC\u7684 demo</span></span>
<span class="line"><span style="color:#393A34;">index.test.ts       </span><span style="color:#A0ADA0;"># \u57FA\u4E8E vitest \u7684\u6D4B\u8BD5</span></span>
<span class="line"><span style="color:#393A34;">index.md            </span><span style="color:#A0ADA0;"># \u6587\u6863</span></span>
<span class="line"></span></code></pre></div><p>for <code>index.ts</code> you should export the function with names.</p><p>\u9700\u8981\u5728 <code>index.ts</code> \u5BFC\u51FA\u51FD\u6570\u540D</p><div class="language-ts"><span class="copy"></span><pre class="vp-code-dark"><code><span class="line"><span style="color:#758575;">// DO</span></span>
<span class="line"><span style="color:#4D9375;">export</span><span style="color:#DBD7CA;"> </span><span style="color:#858585;">{</span><span style="color:#DBD7CA;"> </span><span style="color:#B8A965;">useMyFunction</span><span style="color:#DBD7CA;"> </span><span style="color:#858585;">}</span></span>
<span class="line"></span>
<span class="line"><span style="color:#758575;">// DON&#39;T</span></span>
<span class="line"><span style="color:#4D9375;">export</span><span style="color:#DBD7CA;"> </span><span style="color:#4D9375;">default</span><span style="color:#DBD7CA;"> </span><span style="color:#B8A965;">useMyFunction</span></span>
<span class="line"></span></code></pre><pre class="vp-code-light"><code><span class="line"><span style="color:#A0ADA0;">// DO</span></span>
<span class="line"><span style="color:#1C6B48;">export</span><span style="color:#393A34;"> </span><span style="color:#8E8F8B;">{</span><span style="color:#393A34;"> </span><span style="color:#8C862B;">useMyFunction</span><span style="color:#393A34;"> </span><span style="color:#8E8F8B;">}</span></span>
<span class="line"></span>
<span class="line"><span style="color:#A0ADA0;">// DON&#39;T</span></span>
<span class="line"><span style="color:#1C6B48;">export</span><span style="color:#393A34;"> </span><span style="color:#1C6B48;">default</span><span style="color:#393A34;"> </span><span style="color:#8C862B;">useMyFunction</span></span>
<span class="line"></span></code></pre></div><p>for <code>index.md</code> the first sentence will be displayed as the short intro in the function list, so try to keep it brief and clear.</p><p><code>index.md</code> \u7684\u7B2C\u4E00\u4E2A\u53E5\u5B50\u5C06\u4F5C\u4E3A\u7B80\u4ECB\u5728\u51FD\u6570\u5217\u8868\u4E2D\u5C55\u793A\uFF0C\u6240\u4EE5\u5C3D\u53EF\u80FD\u4FDD\u8BC1\u7B80\u6D01\u660E\u4E86\u3002</p><div class="language-md"><span class="copy"></span><pre class="vp-code-dark"><code><span class="line"><span style="color:#858585;font-weight:bold;">#</span><span style="color:#4D9375;font-weight:bold;"> useMyFunction</span></span>
<span class="line"></span>
<span class="line"><span style="color:#DBD7CA;">This will be the intro. The detail descriptions...</span></span>
<span class="line"></span></code></pre><pre class="vp-code-light"><code><span class="line"><span style="color:#8E8F8B;font-weight:bold;">#</span><span style="color:#1C6B48;font-weight:bold;"> useMyFunction</span></span>
<span class="line"></span>
<span class="line"><span style="color:#393A34;">This will be the intro. The detail descriptions...</span></span>
<span class="line"></span></code></pre></div><p>Read more about the <a href="/vueuse-cn/guidelines.html">guidelines</a>.</p><p>\u9605\u8BFB\u6709\u5173 <a href="/vueuse-cn/guidelines.html">\u6307\u5BFC\u65B9\u9488</a> \u7684\u5185\u5BB9.</p><h2 id="code-style-\u4EE3\u7801\u98CE\u683C" tabindex="-1">Code Style \u4EE3\u7801\u98CE\u683C <a class="header-anchor" href="#code-style-\u4EE3\u7801\u98CE\u683C" aria-hidden="true">#</a></h2><p>Don&#39;t worry about the code style as long as you install the dev dependencies. Git hooks will format and fix them for you on committing. \u53EA\u8981\u5B89\u88C5\u4E86\u5F00\u53D1\u4F9D\u8D56\uFF0C\u5C31\u4E0D\u7528\u62C5\u5FC3\u4EE3\u7801\u683C\u5F0F\u3002Git hooks \u5C06\u5728\u63D0\u4EA4\u65F6\u683C\u5F0F\u5316\u5E76\u4FEE\u590D\u4EE3\u7801\u3002</p><h2 id="thanks-\u81F4\u8C22" tabindex="-1">Thanks \u81F4\u8C22 <a class="header-anchor" href="#thanks-\u81F4\u8C22" aria-hidden="true">#</a></h2><p>Thank you again for being interested in this project! You are awesome!</p><p>\u518D\u6B21\u611F\u8C22\u60A8\u5BF9\u672C\u9879\u76EE\u611F\u5174\u8DA3\uFF01\u4F60\u771F\u68D2\uFF01</p>`,47),p=[l];function t(c,i,d,r,u,h){return s(),n("div",null,p)}var f=e(o,[["render",t]]);export{g as __pageData,f as default};
